import { useDispatch, useSelector } from "react-redux";
import EmployeeItem from "./employeeItem";
import './watchman.css'
const EmployeeList = () => {
    const dispatch = useDispatch()
    const empl = useSelector(state => state.employees.employees)
    console.log(empl)
    var employees = [{id: "1", first_name: "fedor", last_name: "nikolaev"}, {id: "2", first_name: "_namepetr", last_name: "andreevich"}, {id: "3", first_name: "nikita", last_name: "ivanov"}];
    return ( 
        <tbody className="item">
            {employees.map(
                employee =>
                <EmployeeItem employee = {employee}/>
            )}
        </tbody>
    );
};
export default EmployeeList;
